import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";

const Bands = () => {
  const {id} = useParams()


  return (
  <div className="container-bands">
      <h1>Band name: {id}</h1>
  </div>
    )
};

export default Bands;
